    [],nt"revision_timestamp": "2016-08-03T09:20:31.923172",nt"name": "national-assessment-of-hurricane-induced-coastal-erosion-hazards",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains information on the
    probabilities of hurricane-induced erosion (collision, inundation and overwash)
    for each 1-km section of the United States coast for category 1-5 hurricanes. The
    analysis is based on a storm-impact scaling model that uses observations of beach
    morphology combined with sophisticated hydrodynamic models to predict how the coast
    will respond to the direct landfall of category 1-5 hurricanes. Hurricane-induced
    water levels, due to both surge and waves, are compared to beach and dune elevations
    to determine the probabilities of three types of coastal change: collision (dune
    erosion), overwash, and inundation. Data on dune morphology (dune crest and toe
    elevation) and hydrodynamics (storm surge, wave setup and runup) are also included
    in this data set. As new beach morphology observations and storm predictions become
    available, this analysis will be updated to describe how coastal vulnerability to
    storms will vary in the future. The data presented here include the dune morphology
    observations, as derived from lidar surveys.",nt"license_title": null,nt"extras":
